import Link from "next/link";

const Nav = () => (
  <div className="navbar">
    <div className="title">
      <Link href="/">
        <a className="logo">SPECULA</a>
      </Link>
    </div>
    <div className="navitems">
      <Link href="/about">
        <a className="navlink">About</a>
      </Link>
      <Link href="/how">
        <a className="navlink">How</a>
      </Link>
      <Link href="/contact">
        <a className="navlink">Contact</a>
      </Link>
    </div>

    <style jsx>
      {`
        a {
          text-decoration: none;
        }
        .navbar {
          display: flex;
          position: sticky;
          top: 0;
          background-color: pink;
          height: 15vh;
          width: 100%;
          align-items: center;
        }
        .logo {
          display: block;
          padding: 15px;
        }
        .navitems {
          display: flex;
          justify-content: flex-end;
        }
        .navlink {
          display: block;
          border: 1px black solid;
          padding: 7px;
        }
      `}
    </style>
  </div>
);

export default Nav;
